import React, { Component } from 'react';
import axios from 'axios';

class Services extends Component {
  componentDidMount() {
    axios
      .get('https://jsonplaceholder.typicode.com/posts', {})
      .then(response => console.log(response.data));
  }

  render() {
    return (
      <div>
        <h2>Services</h2>
      </div>
    );
  }
}

export default Services;
